('2407','18','7914','Bonde',Null,'Mallorquinische Finca mit Charakter bei Santa Maria','33827','Dieses charmante Landhaus mit viel Charakter verfügt über eine bebaute Fläche von 500 m2, auf einem Grundstück von 24 000 m2. \r\nDas Haupthaus und ein Gästehaus haben 6 Schlafzimmer, 5 Bäder, 1 Gäste WC, verschiedene Sitzgelegenheiten und 2 Küchen. Des Weiteren bietet diese Finca: Zentralheizung, eigener Brunnen, Steinfassade, großer Pool, verschiedene Obstbäume, Palmen, Olivenbäume und Weinreben.\r\nDas völlig unabhängige Gästehaus mit eigener Terrasse vervollständigt die\r\nUnterkunftsmöglichkeiten dieses weitläufigen Anwesens. Immergrüner subtropischer Garten mit Pergolen und mehrere Terrassen aus Marés Stein mit herrlichen Brunnen, sowie ein riesiger beheizbarer Pool und Jacuzzi mit einem exquisiten Poolhaus, runden die wunderschönen Außenanlagen ab. Nach Palma de Mallorca sind es nur 15 Fahrminuten\r\n','33828','3950000','106','2015-12-03 13:45:46','106','2015-12-03 13:46:28',Null,'2530','120','1188',1,'1','0',Null,Null,Null,'33829',Null,'0','0','0',Null,'2015-12-03 13:56:36',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33830',Null,'33831',Null,'33832',Null,'33833','Törge Bonde 657 035 560','33834','0',0,'0');
